                        return false;
                    var fpPromise = FingerprintJS.load();
                    fpPromise.then(function(fp) {
                        return fp.get();
                    }).then(function(result) {
                        user_idF = result.visitorId;
                        vast_replace['[up]'] = user_idF;
                        player.api("update:vast_replace", vast_replace);
                    });
                });
            } catch (error) {}
        </script>
        <template id="time_save">
            <div class="time_save" data-translation-time="{{translation}}" data-episode-time="{{episode}}" data-season-time="{{season}}">
                <div class="time_save-title">{{title}}</div>
                <div class="time_save-title_sub">Желаете продолжить?</div>
                <div class="time_save-btn">
                    <button class="btn primary time_save_success_js" type="button">Да</button>
                    <button class="btn time_save_close_js" type="button">
                        Нет <span class="time_save-timer hidden">20</span>
                    </button>
                </div>
            </div>
        </template>
        <div class="loading">
            <svg width="70px" height="70px" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 100 100" preserveAspectRatio="xMidYMid" class="lds-rolling">
                <circle cx="50" cy="50" fill="none" stroke="#ffffff" stroke-width="5" r="35" stroke-dasharray="164.93361431346415 56.97787143782138" transform="rotate(20.3191 50 50)">
                    <animateTransform attributeName="transform" type="rotate" calcMode="linear" values="0 50 50;360 50 50" keyTimes="0;1" dur="1s" begin="0s" repeatCount="indefinite"></animateTransform>
                </circle>
            </svg>
        </div>
        <div class="error_message hidden">
            <strong>Упс. Ошибка</strong>

        </div>
